import React from 'react';
import style from "./TopScreen.module.css";
import PanelHeader from "./PanelHeader/HeadPanel";
import MineScreen from "./MineScreen/MineScreen";
import Button1 from "./Buttons/Buttons1";
import Button2 from "./Buttons/Buttons2";
import Button3 from "./Buttons/Buttons3";
import Button4 from "./Buttons/Buttons4";
import HeadPanel from "./PanelHeader/HeadPanel";

function TopScreen(props) {
    return (
            <div className={style.top_screen_body}>
                <HeadPanel/>
                <MineScreen/>
                <div className={style.button_block}>
                    <Button1/>
                    <Button2/>
                    <Button3/>
                    <Button4/>
                </div>
            </div>
    );
}

export default TopScreen;
